import React from "react";
import {Link} from "react-router-dom";
import "./Navigation.css";

function Navigation(){
    return (
        <nav className = "header">
            <div className = "corp_name">
                <img className = "corp_name" src = "./logo.png" alt = "HWASEON"/>
            </div>
        </nav>
    )
}

export default Navigation;
